Defendant David Arthur Thompson in court with attorney Debra J. Patterson.  Maureen Ami Atwell appeared for the State of Wisconsin.  Deputy Court Clerk: dds.

Sentencing proceeded.  Statements made by State, Kelly K., defense, and defendant. 
 
AS TO COUNT 1:  The Court sentenced the defendant to a MAXIMUM TERM OF IMPRISONMENT of 2 1/2 YEARS with credit for 2 days served.  The INITIAL TERM OF CONFINEMENT in the Wisconsin State Prison System is 1 YEAR.  The MAXIMUM TERM OF EXTENDED SUPERVISION IS 18 MONTHS.

AS TO COUNTS 2 AND 3:  The Court sentenced the defendant to a MAXIMUM TERM OF IMPRISONMENT of 3 1/2 YEARS ON EACH COUNT, CONCURRENT to each other, CONSECUTIVE to Count 1 with credit for 0 days served. The INITIAL TERM OF CONFINEMENT in the Wisconsin State Prison System is 18 MONTHS.  The MAXIMUM TERM OF EXTENDED SUPERVISION IS 2 YEARS.

The defendant IS NOT eligible for the Challenge Incarceration Program OR the Substance Abuse Program.

CONDITIONS OF EXTENDED SUPERVISION:
*Obtain Mental health assessment if necessary complete follow-up treatment- take all prescription medication as prescribed by a treating physician;
*Obtain AODA assessment and if necessary successfully complete follow-up treatment;
*Cooperate with any and all rules set forth by the probation agent;
*No new law violations rising to the level of probable cause;
*Participate in Cognitive Thinking program;
*Participate in Parenting class;
*Participate in Anger Management class if deemed appropriate;
*Obtain/maintain full time employment;
*Pay all supervision fees;
*Provide DNA sample if not previously done so- pay surcharge;
*Pay all applicable mandatory surcharges, fees, assessments, and costs after restitution paid in full; 

The Court finds the state in compliance with victim rights legislation.  The Court ordered restitution in the stipulated amount of $61,156.07 payable to Wisconsin Support Collections Trust Fund- to be paid first.  The Court ordered that all financial obligations and restitution be paid through collection of sums by the Department of Corrections from 25% of funds under Sec. 973.05(4)(b) and as a condition of extended supervision.  Any amount remaining due and owing is subject to civil judgment.  Pursuant to Wisconsin Statutes Section 973.176, the Court advised the defendant of the following restrictions:  Firearm possession and Voting.  Appeal rights given.
